import React from "react";


class DemoApp1 extends React.Component{
    // Neu co khai bao contructor thi phai them props va co super
    constructor(props){
        super(props)
    }
    render(){
        return(
            <>
                <h1> WELLCOME {this.props.firstName} {this.props.lastName}</h1>
                <h1> Test demoapp1</h1>
            </>
        )
    }
}
export default DemoApp1;
